        <meta charset="UTF-8">
        <title>point</title>
            <script>var len;
var slides;
var index = 0;
document.addEventListener('keydown', function(e){
  slides = document.getElementsByClassName('slide');
  len = slides.length;
  if (e.keyCode === 37) {
    index--
  } else if (e.keyCode === 39) {
    index++
  }
  index %= len;
  if (index < 0) {index = 0}
  Array.from(slides).forEach(function (e, i) {
    if (i == index){
      e.style.display = 'block'
    } else {
      e.style.display = 'none'
    }
  })
})

</script>

ul{
    margin: 0.75em 0;
    padding: 0 1em;
    list-style: none;
}
ul li:before { 
    content: "\2BC8";
    color: #3230a4;
}
ol {
    list-style: none;
    counter-reset: li;
}
ol li::before
{
    color: #3230a4;
    content: counter(li);
    display: inline-block;
    width: 1em;
    margin-left: -1em

}
ol li{
    counter-increment: li;
}
.slide{
    margin: 25%;
    width: 50%
}

            .slide{
                display: none
            }
            .slide:first-of-type {
                display: block
            }
